ALPSI (Agent-Lié de PSI)

L’Agent lié est une personne physique ou morale qui sous la responsabilité entière et inconditionnelle d'une seule et unique entreprise d'investissement pour le compte de laquelle elle agit, assure auprès des clients ou clients potentiels de cette entreprise:
- La promotion de ses services;
- Recueille et lui transmet les instructions ou les ordres des clients;
- Place des instruments financiers ;
- Fournit des conseils sur des instruments financiers ou les services offerts par l'entreprise d'investissement.

Les agents liés doivent être inscrits au registre unique de l'ORIAS.

